import logo from './logo.svg';
import './App.css';
import Signup from './Signup.js';
import Login from './Login.js';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <>
    <Router>
      <Switch>
        <Route exact path="/Signup">
          <Signup />
        </Route>
      </Switch>
    </Router>
    </>
  );
}

export default App;
